              src={item?.imageUrl}
              width={250}
              height={250}
              style={{ borderRadius: 10 }}
            />
            <Box style={{ padding: 5}}>
              <StyledTitle>{item?.title}</StyledTitle>
              <p>published by {item?.title}</p>

              <Typography style={{ alignItems: "center", display: "flex" }}>
                <img
                  src="https://avatars.githubusercontent.com/u/6250754?s=200&v=4"
                  width={50}
                />
