                  {item?.price}
                </span>
              </Typography>
              <StyledButton onClick={handleBuyNFT}>Buy NFT</StyledButton>
            </Box>
          </Stack>
          <Box style={{ padding: 5, marginTop : 10 }}>
            <StyledTitle>NFT Description</StyledTitle>
            <p>{item?.description}</p>
          </Box>
        </Box>
        <Typography></Typography>
      </Box>
    </Modal>
